import React from 'react';

import UsersList from '../components/UsersList';

const Users = () => {
    const USERS = [
        {
            id:'u1', 
            name:'Julia', 
            image:'https://bit.ly/3g3lDL9', 
            events:3,
        }
    ];

    return <UsersList items={USERS}/>;

};

export default Users;
